import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
//nodejs library that concatenates classes
import withStyles from "@material-ui/core/styles/withStyles";
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';


import {tileData , ImageGridListStyle } from "assets/jss/material-kit-react/components/imageGridListStyle.jsx";

const ImageGridList = ({...props}) => {
	const { classes } = props;
	return (
	<div >
		<div className={classes.root}>
		  <GridList cellHeight={120} className={classes.gridList} cols={3}>
		    {tileData.map(tile => (
		      <GridListTile key={tile.img} cols={tile.cols || 1}>
		        <img src={tile.img} alt={tile.title} />
		      </GridListTile>
		    ))}
		  </GridList>
		</div>
	</div>
	);
}

ImageGridList.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles({tileData, ImageGridListStyle})(ImageGridList);
